    body:
      encoding: ASCII-8BIT
      string: '{"id":615656,"page":1,"results":[{"author":"CinemaSerf","author_details":{"name":"CinemaSerf","username":"Geronimo1967","avatar_path":"/1kks3YnVkpyQxzw36CObFPvhL5f.jpg","rating":5.0},"content":"Now
        the \"Meg\" (2018) itself could never be called a good film, but it is a great
        deal better than this muddled and derivative effort. \"Jonas\" (Jason Statham)
        is now working as a sort of eco-policeman trying to stop the dumping of toxic
        waste into the oceans, and after a snappy \"007\" style opening, he is daringly
        rescued by \"Mac\" (Clff Curtis) and \"Rigas\" (Melissanthu Mahut) and returned
        to the research centre where he is reunited with \"Jess\" (Skyler Samuels),
        \"DJ\" (Page Kennedy) and the adrenalin seeking \"Juiming\" (Jing Wu) who
        are nursing the daughter of the last megalodon! The team now travel to a remote
        installation where they must investigate some more of the beasties that live
        below the frozen layer put there by nature to ensure than we don''t mix. Thing
        is, it seems they are not the only folks who''ve hit on the idea that there
        might be untapped riches 25,000 feet below the surface, and soon our team
        are involved in a contretemps with \"Montes\" (Sergio Peris-Mencheta) that
        introduces treachery, double-dealing and causes explosions galore that release
        not just megs, but also an enormous octopus into the ocean where they can
        merrily terrorise the holidaymakers on the nearby resort of \"Fun Island\".
        Can \"Jonas\" et al manage to take on four of these super-creatures before
        they''ve snacked their way through the tourists? This might have been a bit
        better if they''d just cut all the preamble and gone straight to the rig and
        to the underwater action, big fish and pyrotechnics. As it is, we spend far
        too long meandering about on the surface meeting the characters and there''s
        way too much pointless dialogue throughout - though one or two half-hearted
        witticisms and puns help a little - before an ending that is entirely predictable
        and really rather processionally so. The acting is just banal, the continuity
        is all over the place - as is the editing - and the huge chunk of Ali Baba
        money that''s floated this thing ensures that the switches from the English
        to Chinese languages actually smacks more of keeping everybody happy in the
        boardroom rather than engaging anyone in the actual cinema. Simply, even the
        charismatic Statham cannot rescue this from the doldrums of CGI-led mediocrity
        that churns out an unremarkable hybrid of \"Jaws\" and \"Jurassic Park\".
        It does need a big screen. If you wait til it''s on the telly then you will
        be even more disappointed. Mind you, is that actually possible?","created_at":"2023-08-12T06:21:56.587Z","id":"64d72504d100b6011c8180f6","updated_at":"2023-08-12T06:21:56.728Z","url":"https://www.themoviedb.org/review/64d72504d100b6011c8180f6"}],"total_pages":1,"total_results":1}'
