      encoding: ASCII-8BIT
      string: '{"id":709631,"page":1,"results":[{"author":"MovieGuys","author_details":{"name":"","username":"MovieGuys","avatar_path":null,"rating":6.0},"content":"Cobweb
        taps into well worn horror concepts and delivers something a little different
        but hardly surprising.\r\n\r\nWe all know from the get go, what Cobweb represents
        in broad terms. A tale of a child, locked away by its parents, because its
        different and more than a little, sinister.\r\n\r\nStepping beyond the predictable,
        is a few tweaks that set this horror film apart. Mostly, in a good way. Cleverly
        re-working aspects of a classic premise, pays dividends in terms of scares
        and a surprising reveal.\r\n\r\nWhat doesn''t work so well, is the family
        dynamic. We all knows its dysfunctional. The fact its so coldly, over stated,
        feels oppressive. Injecting a little more genuine warmth, into the family
        dynamic, would have heightened the impact, of the horror, that inevitably
        unfolds. \r\n\r\nActing is decent, especially given the young age of some
        cast members. \r\n\r\nOnly thing I''m not so sure about is why the voice over
        for the sister character, ends up sounding like Marge Simpsons, spinster sisters?
        \r\n\r\nIn summary, enough that''s new, grafted onto a well established horror
        premise, to make this film a success. Somewhat let down, by heavy handling,
        surrounding the family dynamic.","created_at":"2023-08-14T04:47:59.140Z","id":"64d9b1ffb6c264115754a57f","updated_at":"2023-08-14T20:28:21.754Z","url":"https://www.themoviedb.org/review/64d9b1ffb6c264115754a57f"}],"total_pages":1,"total_results":1}'
