      string: '{"id":1121575,"page":1,"results":[{"author":"MovieGuys","author_details":{"name":"","username":"MovieGuys","avatar_path":null,"rating":7.0},"content":"Babylon
        V The Road Home offers up an enjoyable nostalgia trip, for fans of the original
        90''s series.\r\n\r\nAs a big BV fan I really enjoyed this animated romp into
        the sci fi world of this series. It offered a new, fresh take on what had
        gone before and was, for the most part, entertaining.\r\n\r\nIt would have
        been nice to see a live film but given the actors have aged substantially
        and some are no longer with us, I can see why an animated production, with
        voice overs from actors from the original series, was utilised.\r\n\r\nMy
        only criticism, is this film doesn''t really offer a lot by way of back story.
        For those new to the franchise, many no doubt born after the series took place,
        it may be a little hard to follow, at times.\r\n\r\nIn summary, nice to see
        BV back in any form. It was and is, a great series that''s been much missed,
        by fans like myself.","created_at":"2023-08-16T02:27:24.481Z","id":"64dc340cf495ee028f664a90","updated_at":"2023-08-16T02:27:24.575Z","url":"https://www.themoviedb.org/review/64dc340cf495ee028f664a90"}],"total_pages":1,"total_results":1}'
