      string: '{"id":1149381,"page":1,"results":[{"author":"MovieGuys","author_details":{"name":"","username":"MovieGuys","avatar_path":null,"rating":5.0},"content":"Polish
        film Soulcatcher''s key shortcoming is doing too many things badly, when it
        could have done fewer things, well.\r\n\r\nThe story starts off engagingly
        enough and it looks like we are being set up for a zombie style, military
        action flick, with a sci fi tie in. Instead of developing this idea and running
        with it, this film then moves into a fictional weapon of mass destruction
        (that turn''s people into violent, zombie like killers) scenario and throws
        in half baked, political intrigue.\r\n\r\nAction is still core of this film
        but its bumps jarringly over the roughly rutted, plot hole infested path,
        of inconsistent storytelling. The results an unsatisfying watch that leaves
        a strong sense of indifference.\r\n\r\nThe remaining positives include fair
        to middling action sequences and decent acting. Clearly some money has been
        spent, on these aspects of the film.  \r\n\r\nIn summary, oftentimes, \"less
        is more\", especially when you are dealing with what is presumably, a straightforward
        action driven flick.","created_at":"2023-08-03T03:19:04.612Z","id":"64cb1ca8764b99011df4fc3d","updated_at":"2023-08-07T21:05:38.216Z","url":"https://www.themoviedb.org/review/64cb1ca8764b99011df4fc3d"}],"total_pages":1,"total_results":1}'
